import { HttpClient } from '@angular/common/http';
import { Component } from '@angular/core';

interface CityWeather {
  name: string;
  temperature: number;
  humidity: number;
}

@Component({
  selector: 'app-weather',
  templateUrl: './weather.component.html',
  styleUrls: ['./weather.component.css']
})
export class WeatherComponent {
  cities: CityWeather[] = [];
  cityInput: string = '';
  private apiUrl = 'http://localhost:8080/weather';

  constructor(private http: HttpClient) {}

  addCity(): void {
    if (this.cityInput) {
      const cityName = this.cityInput.trim();
      if (!this.isCityDuplicate(cityName)) {
        this.fetchWeatherData(cityName);
      } else {
        alert('City already exists');
      }
      this.cityInput = '';
    }
  }

  isCityDuplicate(cityName: string): boolean {
    return this.cities.some(city => city.name.toLowerCase() === cityName.toLowerCase());
  }

  fetchWeatherData(cityName: string): void {
    const url = `${this.apiUrl}/${cityName}`;
    this.http.get(url).subscribe(
      (data: any) => {
        const cityWeather: CityWeather = {
          name: cityName,
          temperature: data.main.temp,
          humidity: data.main.humidity
        };
        this.cities.push(cityWeather);
      },
      (error) => {
        console.log(error);
      }
    );
  }

  removeCity(city: CityWeather): void {
    const index = this.cities.indexOf(city);
    if (index !== -1) {
      this.cities.splice(index, 1);
    }
  }

  getBackgroundImageUrl(temperature: number): string {
    if (temperature > 30) {
      return '../../assets/sunny.webp';
    } else if (temperature < 20) {
      return '../assets/Cold.webp';
    } else {
      return '../../assets/sunny.webp';
    }
  }
}
